import React, { useState } from 'react';
import './FooterBlob.css';


function FooterBlob() {
  return (
      <div className='footerBlob'>
          <img src='/images/FooterBlob.png' className='footerBlobImg' />
      </div>
  );
}

export default FooterBlob;
